import React, { Component, ReactDOM } from 'react';
import logo from '../logo.svg';
//import logo from './logo2.png'
import '../css/Visual.css';
import  * as vis from 'react-vis-force';
import { Graph } from 'react-d3-graph';

 
var mouseX = 0;
var mouseY = 0;
// graph payload (with minimalist structure)
const data = {
    nodes: [{ id: 'Harry', color: "lightgreen", size: 1200}, { id: 'Sally', size: 400, color: "red" }, { id: 'Alice', size: 650, color: "blue" }],
    links: [{ source: 'Harry', target: 'Sally' }, { source: 'Harry', target: 'Alice' }]
};
 
// the graph configuration, you only need to pass down properties
// that you want to override, otherwise default ones will be used
const myConfig = {
        automaticRearrangeAfterDropNode: true,
        collapsible: false,
        directed: true,
        focusAnimationDuration: 0.25,
        focusZoom: 1,
        highlightOpacity: 1,
        linkHighlightBehavior: false,
        maxZoom: 8,
        minZoom: 0.1,
        nodeHighlightBehavior: false,
        panAndZoom: false,
        staticGraph: false,
    d3: {
        alphaTarget: 0.05,
        gravity: -500,
        linkLength: 100,
        linkStrength: 1
    },
    node: {
        renderLabel: true,
        fontSize: "18px",
        // color: '#8CDCDA',
        // size: 400,
        svg: "",
        highlightStrokeColor: 'blue'
    },
    link: {
        fontWeight: "normal",
        // type: "CURVE_SMOOTH",
        highlightColor: 'lightblue'
    },
};




export class Visual extends Component {

    componentDidMount(){

    }

    constructor(props){

        super(props);

    }

    // graph event callbacks
    onClickGraph = function() {
        // window.alert(`Clicked the graph background`);
    };
    
    onClickNode = function(nodeId) {
        for(let i = 0; i < data.nodes.length; i++){
            if(data.nodes[i].id === nodeId){
                console.log(data.nodes[i].size);
            }
        }
        // console.log(event.clientX);
        // window.alert(`Clicked node ${nodeId}`);
    };
    
    onRightClickNode = function(event, nodeId) {
        // window.alert(`Right clicked node ${nodeId}`);
    };
    
    onMouseOverNode = function(nodeId) {
        // window.alert(`Mouse over node ${nodeId}`);
    };
    
    onMouseOutNode = function(nodeId) {
        // window.alert(`Mouse out node ${nodeId}`);
    };
    
    onClickLink = function(source, target) {
        // window.alert(`Clicked link between ${source} and ${target}`);
    };
    
    onRightClickLink = function(event, source, target) {
        // window.alert(`Right clicked link between ${source} and ${target}`);
    };
    
    onMouseOverLink = function(source, target) {
        // window.alert(`Mouse over in link between ${source} and ${target}`);
    };
    
    onMouseOutLink = function(source, target) {
        // window.alert(`Mouse out link between ${source} and ${target}`);
    };



    render() {

        const modalStyle = {
            color: 'blue',
            backgroundImage: 'url(' + imgUrl + ')',
          };

        return (
            <div onMouseMove={function(e){
                mouseX = e.clientX;
                mouseY = e.clientY;
                console.log(mouseX);
                console.log(mouseY);
            }}>
                <Graph
                    id="graph-id" // id is mandatory, if no id is defined rd3g will throw an error
                    data={data}
                    config={myConfig}
                    onClickNode={this.onClickNode}
                    onRightClickNode={this.onRightClickNode}
                    onClickGraph={this.onClickGraph}
                    onClickLink={this.onClickLink}
                    onRightClickLink={this.onRightClickLink}
                    onMouseOverNode={this.onMouseOverNode}
                    onMouseOutNode={this.onMouseOutNode}
                    onMouseOverLink={this.onMouseOverLink}
                    onMouseOutLink={this.onMouseOutLink}
                />;
                <div style={modalStyle} className="modal">

                </div>
          </div>
        )
    }
}

